import styled from "styled-components"


const Container  = styled.div``

const CategoryItem = ({item}) => {
  return (
    <Container>
        <Image src = {item.img}/>
        <Info>
            <Title>{item.tile}</Title>
            
        </Info>
    </Container>
  )
}

export default CategoryItem
